import React, { useEffect, useRef } from 'react';
import Chart from 'chart.js/auto';
import 'chartjs-adapter-date-fns';
import './ForecastChart.css';

const ForecastChart = ({ data, forecast, optimizedForecast, impacts }) => {
  const chartRef = useRef(null);
  const chartInstance = useRef(null);

  // Clean up chart on unmount
  useEffect(() => {
    return () => {
      if (chartInstance.current) {
        chartInstance.current.destroy();
        chartInstance.current = null;
      }
    };
  }, []);

  useEffect(() => {
    if (!forecast || !chartRef.current) return;

    // Destroy previous chart if it exists
    if (chartInstance.current) {
      chartInstance.current.destroy();
      chartInstance.current = null;
    }

    try {
      const ctx = chartRef.current.getContext('2d');

      // Group actual data by month
      const monthlyData = {};

      if (data && data.length > 0) {
        data.forEach(item => {
          if (!item.date || !item.emissions) return;

          const date = new Date(item.date);
          // Format as YYYY-MM for grouping
          const monthKey = `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(2, '0')}`;

          if (!monthlyData[monthKey]) {
            // Create a date for the 15th of the month to ensure it's centered in the month
            monthlyData[monthKey] = {
              date: new Date(date.getFullYear(), date.getMonth(), 15),
              emissions: 0
            };
          }

          monthlyData[monthKey].emissions += parseFloat(item.emissions) || 0;
        });
      }

      // Convert to array and sort by date
      const actualData = Object.values(monthlyData).sort((a, b) => a.date - b.date);

      // Format data for chart
      const actualDates = actualData.map(d => d.date);
      const actualValues = actualData.map(d => d.emissions);

      // Process forecast data - ensure dates are set to the 15th of each month for better display
      const forecastDates = forecast.map(d => {
        const date = new Date(d.ds);
        return new Date(date.getFullYear(), date.getMonth(), 15);
      });
      const forecastValues = forecast.map(d => d.predicted_emissions);
      const lowerBounds = forecast.map(d => d.lower_bound);
      const upperBounds = forecast.map(d => d.upper_bound);

      // Process optimized data if available - also set to 15th of month
      let optimizedDates = [];
      let optimizedValues = [];

      if (optimizedForecast && optimizedForecast.length > 0) {
        optimizedDates = optimizedForecast.map(d => {
          const date = new Date(d.ds);
          return new Date(date.getFullYear(), date.getMonth(), 15);
        });
        optimizedValues = optimizedForecast.map(d => d.predicted_emissions);
      }

      // Create datasets
      const datasets = [];

      // Add actual data if available
      if (actualData.length > 0) {
        datasets.push({
          label: 'Actual Emissions',
          data: actualDates.map((date, index) => ({
            x: date,
            y: actualValues[index]
          })),
          borderColor: '#00FFFF', // Cyan
          backgroundColor: 'rgba(0, 255, 255, 0.1)',
          borderWidth: 3,
          pointBackgroundColor: '#00FFFF',
          pointBorderColor: '#00FFFF',
          pointRadius: 7,
          pointHoverRadius: 9,
          tension: 0.4,
          fill: false
        });
      }

      // Add forecast data
      datasets.push({
        label: 'Forecast Emissions',
        data: forecastDates.map((date, index) => ({
          x: date,
          y: forecastValues[index]
        })),
        borderColor: '#FF00FF', // Magenta
        backgroundColor: 'rgba(255, 0, 255, 0.1)',
        borderWidth: 3,
        pointBackgroundColor: '#FF00FF',
        pointBorderColor: '#FF00FF',
        pointRadius: 7,
        pointHoverRadius: 9,
        tension: 0.4,
        fill: false
      });

      // Add confidence interval
      datasets.push({
        label: 'Confidence Interval',
        data: forecastDates.map((date, index) => ({
          x: date,
          y: upperBounds[index]
        })),
        borderColor: 'rgba(255, 0, 255, 0.3)',
        backgroundColor: 'transparent',
        borderWidth: 1,
        borderDash: [5, 5],
        pointRadius: 0,
        fill: false
      });

      datasets.push({
        label: 'Confidence Interval',
        data: forecastDates.map((date, index) => ({
          x: date,
          y: lowerBounds[index]
        })),
        borderColor: 'rgba(255, 0, 255, 0.3)',
        backgroundColor: 'rgba(255, 0, 255, 0.1)',
        borderWidth: 1,
        borderDash: [5, 5],
        pointRadius: 0,
        fill: '-1'
      });

      // Add optimized forecast if available
      if (optimizedValues.length > 0) {
        datasets.push({
          label: 'Optimized Emissions',
          data: optimizedDates.map((date, index) => ({
            x: date,
            y: optimizedValues[index]
          })),
          borderColor: '#00FF00', // Green
          backgroundColor: 'rgba(0, 255, 0, 0.1)',
          borderWidth: 3,
          borderDash: [5, 5],
          pointBackgroundColor: '#00FF00',
          pointBorderColor: '#00FF00',
          pointRadius: 7,
          pointHoverRadius: 9,
          tension: 0.4,
          fill: false
        });
      }

      // Create chart
      chartInstance.current = new Chart(ctx, {
        type: 'line',
        data: {
          datasets: datasets
        },
        options: {
          responsive: true,
          maintainAspectRatio: false,
          animation: {
            duration: 2000,
            easing: 'easeOutQuart'
          },
          scales: {
            x: {
              type: 'time',
              time: {
                unit: 'month',
                displayFormats: {
                  month: 'MMM yyyy'
                },
                tooltipFormat: 'MMMM yyyy'
              },
              title: {
                display: true,
                text: 'Month',
                color: '#ccc',
                font: {
                  family: 'Orbitron',
                  size: 14
                }
              },
              grid: {
                color: 'rgba(255, 255, 255, 0.1)'
              },
              ticks: {
                color: '#ccc',
                font: {
                  family: 'Roboto',
                  size: 12
                },
                maxRotation: 45,
                minRotation: 45
              },
              // Add some padding to ensure January 2023 is fully visible
              min: new Date('2022-12-15'),
              offset: true
            },
            y: {
              title: {
                display: true,
                text: 'Monthly Emissions (tons CO2e)',
                color: '#ccc',
                font: {
                  family: 'Orbitron',
                  size: 14
                }
              },
              grid: {
                color: 'rgba(255, 255, 255, 0.1)'
              },
              ticks: {
                color: '#ccc',
                font: {
                  family: 'Roboto',
                  size: 12
                }
              }
            }
          },
          plugins: {
            legend: {
              position: 'top',
              labels: {
                font: {
                  family: 'Orbitron',
                  size: 12
                },
                color: '#fff',
                padding: 20,
                filter: function(item) {
                  // Hide one of the confidence interval labels
                  return item.text !== 'Confidence Interval' || item.datasetIndex === 2;
                }
              }
            },
            tooltip: {
              enabled: true,
              mode: 'nearest',
              intersect: false,
              backgroundColor: 'rgba(0, 0, 0, 0.8)',
              titleFont: {
                family: 'Orbitron',
                size: 14
              },
              bodyFont: {
                family: 'Roboto',
                size: 13
              },
              borderColor: 'rgba(0, 255, 255, 0.3)',
              borderWidth: 1,
              callbacks: {
                title: function(tooltipItems) {
                  if (tooltipItems.length > 0) {
                    const date = new Date(tooltipItems[0].parsed.x);
                    return date.toLocaleDateString('default', { month: 'long', year: 'numeric' });
                  }
                  return '';
                },
                label: function(context) {
                  let label = context.dataset.label || '';

                  if (label) {
                    label += ': ';
                  }

                  if (context.parsed.y !== null) {
                    label += context.parsed.y.toFixed(2) + ' tons CO2e';
                  }

                  return label;
                }
              }
            }
          },
          elements: {
            point: {
              radius: 7,
              hoverRadius: 9,
              hitRadius: 10
            },
            line: {
              tension: 0.4
            }
          },
          layout: {
            padding: {
              left: 15,
              right: 15,
              top: 20,
              bottom: 20
            }
          }
        }
      });
    } catch (error) {
      console.error("Error creating chart:", error);
    }
  }, [data, forecast, optimizedForecast]);

  return (
    <div className="forecast-chart-container">
      <h3 className="chart-title">Monthly Carbon Emissions Forecast</h3>
      <div className="chart-container">
        <canvas ref={chartRef}></canvas>
      </div>

      {impacts && Object.keys(impacts).length > 0 && (
        <div className="impact-factors">
          <h4>Key Impact Factors</h4>
          <div className="impact-list">
            {Object.entries(impacts)
              .sort((a, b) => Math.abs(b[1].impact_score) - Math.abs(a[1].impact_score))
              .slice(0, 3)
              .map(([factor, data], index) => {
                let factorName = factor;
                if (factor === 'energy_use') factorName = 'Energy Use';
                if (factor === 'transport') factorName = 'Transport';
                if (factor === 'waste') factorName = 'Waste';
                if (factor === 'water') factorName = 'Water';
                if (factor === 'fuel') factorName = 'Fuel';
                if (factor === 'grid_intensity') factorName = 'Grid Intensity';

                return (
                  <div key={factor} className="impact-item">
                    <div className="impact-rank">{index + 1}</div>
                    <div className="impact-info">
                      <div className="impact-name">{factorName}</div>
                      <div className="impact-score">
                        Impact Score: <span className="impact-value">{Math.abs(data.impact_score).toFixed(2)}</span>
                      </div>
                    </div>
                  </div>
                );
              })}
          </div>
        </div>
      )}
    </div>
  );
};

export default ForecastChart;
